The last 50 days have not been easy. For either Nokum or me. I've stayed on top of things for her though, and the Doctors say she's clear to be moved to rehabilitation as soon as there's a bed over there. I on the other hand have had dental surgery, a new crown put in, an appointment with a surgeon the dentist was THAT worried, a cancer scare, and an MRI with contrast that kicked my legs out from under me for a week. Still kept all the balls in the air for Nokum. Still managed to advocate for her and fight for her and get her food and... Still managed to not get Covid and die.

But it's been 50 days, and I am exhausted. I don't dare ever tell her what I was going through at the same time, or that the stress has made my CIS-MS symptoms worse lately, because if she knew she'd stop asking me for help and she's not in a position where it's safe to do that. But I'm saying it here. 

I'm exhausted.

The 6th will be 8 months in lockdown.

Still waiting on that Covid Relief for people with disabilities the Fed keep putting out press releases about and then all we get is crickets and tumbleweeds.

But Nokum is stable and her Doctors say she's well enough to move on to Rehabilitation. And I am so happy, and so relieved, and so grateful....

And so exhausted.

